import React, { useState, useEffect } from 'react';

const Counter = () => {
  const [count, setCount] = useState(0);
  useEffect(() => {
    setCount(count++);
  });
  return (
    <>
      <h1>Counter: {count} </h1>
      <button onClick={() => useEffect()}> Add 1 </button>
    </>
  );
}

export default Counter;
